import React from 'react'
import * as TiIcons from 'react-icons/ti';
import * as AiIcons from 'react-icons/ai';


export const  SidebarData= [

    {
    title:"Accueil",
    path:"/",
    icon: <AiIcons.AiFillHome></AiIcons.AiFillHome>,
    cname: "nav-text"
    },
    {
        title:"Profil",
        path:"/account",
        icon: <AiIcons.AiOutlineMan></AiIcons.AiOutlineMan>,
        cname: "nav-text"
    },
    {
        title:"connexion",
        path:"/login",
        icon: <AiIcons.AiOutlineHeart></AiIcons.AiOutlineHeart>,
        cname: "nav-text"
    }

  
];
